import{_ as s,c as a,o as r,aM as i}from"./chunks/framework.DAyGILei.js";const t="data:image/png;base64,",u=JSON.parse('{"title":"Overview","description":"This page gives an overview of the HUNT Cloud services.","frontmatter":{"title":"Overview","category":"Services","outline":"2-3","permalink":"/administer-science/services/overview","description":"This page gives an overview of the HUNT Cloud services."},"headers":[],"relativePath":"administer-science/services/overview.md","filePath":"administer-science/services/overview.md"}'),d={name:"administer-science/services/overview.md"};function o(l,e,c,n,m,h){return r(),a("div",null,[...e[0]||(e[0]=[i('<h1 id="services" tabindex="-1">Services <a class="header-anchor" href="#services" aria-label="Permalink to &quot;Services&quot;">​</a></h1><p><strong>Get a quick overview below of the services components that makes up your lab.</strong></p><nav class="table-of-contents"><ul><li><a href="#data-space-subscriptions">Data space subscriptions</a><ul><li><a href="#lab-subscription">Lab subscription</a></li></ul></li><li><a href="#individual-services">Individual services</a><ul><li><a href="#compute">Compute</a></li><li><a href="#storage">Storage</a></li><li><a href="#transfer">Transfer</a></li></ul></li></ul></nav><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>See the <a href="/administer-science/services/specifications">Services specifications</a> for detailed documentation.</p></div><h2 id="data-space-subscriptions" tabindex="-1">Data space subscriptions <a class="header-anchor" href="#data-space-subscriptions" aria-label="Permalink to &quot;Data space subscriptions&quot;">​</a></h2><p>Data spaces establishes a management account (data space) in HUNT Cloud where individual labs are attached and their resources managed, controlled and billed.</p><p>We have established two subscription levels, EXPLORE and EVOLVE. Both are free of charge. They differ in our internal follow-up as EXPLORE are aimed at larger units and EVOLVE are aimed at scientific groups and centers.</p><table tabindex="0"><thead><tr><th>Subscription levels:</th><th>EXPLORE</th><th>EVOLVE</th></tr></thead><tbody><tr><td>Cost</td><td>Free</td><td>Free</td></tr><tr><td>Maximum attached labs</td><td>Unlimited</td><td>Unlimited</td></tr><tr><td>Maximum commitment length</td><td>3 YEARS</td><td>3 YEARS</td></tr><tr><td>Storage volume discount*</td><td><img src="'+t+'" alt="yes" title="yes"></td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Multiple billing accounts</td><td><img src="'+t+'" alt="no" title="yes"></td><td><img src="'+t+'" alt="yes" title="yes"></td></tr></tbody></table><p>*) Volume discounts for storage is calculated across all resources attached to one data space.</p><h3 id="lab-subscription" tabindex="-1">Lab subscription <a class="header-anchor" href="#lab-subscription" aria-label="Permalink to &quot;Lab subscription&quot;">​</a></h3><p><strong>This is the subscription that gives to access to one digital laboratory where you add resources for computation and storage.</strong></p><p>One to many labs can be organized under one data space.</p><table tabindex="0"><thead><tr><th>Subscription level:</th><th>LAB</th></tr></thead><tbody><tr><td>Commitment length</td><td>1 or 3 YEARS</td></tr><tr><td>Number of users per lab</td><td>Unlimited</td></tr><tr><td>Secure processing environment</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Web-based Workbench</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>SSH connection</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Desktop service</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Default scientific tools</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Bring your own tools</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Bring your own data</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Expandable compute services</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Compute COMMITMENT machines</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Compute ON-DEMAND machines</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Compute SPOT machines</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>GPU accelerators</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Expandable storage</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Regular storage</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>NVMe storage</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Tape storage</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Restore functionality*</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Free internal transfers</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Free external imports</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Free external exports</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Access to new pilot services</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr></tbody></table><p>*) Restore against accidental deletion is activate for work and archive volumes on home machines.</p><h2 id="individual-services" tabindex="-1">Individual services <a class="header-anchor" href="#individual-services" aria-label="Permalink to &quot;Individual services&quot;">​</a></h2><h3 id="compute" tabindex="-1">Compute <a class="header-anchor" href="#compute" aria-label="Permalink to &quot;Compute&quot;">​</a></h3><p>This is the service that deploys one to many virtual machines for data analysis in labs. The service allows you to deploy both short term and long term <a href="/administer-science/services/machine-types">machine types</a> of various sizes.</p><h3 id="storage" tabindex="-1">Storage <a class="header-anchor" href="#storage" aria-label="Permalink to &quot;Storage&quot;">​</a></h3><p>This is the service that deploy storage resources to virtual machines in labs. The default service allows you to attach one to many storage volumes (disks) to your lab machines.</p><table tabindex="0"><thead><tr><th>Subscription levels:</th><th>LAB</th></tr></thead><tbody><tr><td>Restore*</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Expandable storage</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Regular storage (hard drives)</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Speed-optimized storage (NVMe)</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Tape storage</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Volume discount**</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr></tbody></table><p>*) Restore against accidental deletion is activate for work and archive volumes on home machines.</p><p>**) Volume discounts for storage is calculated across all resources attached to one data space.</p><h3 id="transfer" tabindex="-1">Transfer <a class="header-anchor" href="#transfer" aria-label="Permalink to &quot;Transfer&quot;">​</a></h3><p>This is the service that enables compliant data transfers to and from labs, both between labs inside HUNT Cloud and to and from parties outside HUNT Cloud.</p><table tabindex="0"><thead><tr><th>Subscription levels:</th><th>LAB</th></tr></thead><tbody><tr><td>Free internal transfers</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Free external imports</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Free external exports</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr><tr><td>Free network openings</td><td><img src="'+t+'" alt="yes" title="yes"></td></tr></tbody></table>',25)])])}const y=s(d,[["render",o]]);export{u as __pageData,y as default};
